import React from 'react';
import '../styles/sidecontainer.css';

const SideContainer = () => {
    return (
        <div className="side-container">
            <ul>
                <li><a href="#details">1</a></li>
                <li><a href="#event">2</a></li>
                <li><a href="#confirm">3</a></li>
            </ul>
        </div>
    );
}

export default SideContainer;
